actionConfiguration.body:
() => {
		let loginQueryResult = loginQuery.data;
		if (loginQueryResult.length >= 1) {
		if (adminCheckbox.isChecked) {
			let adminQueryResult = loginQueryResult.filter(x => x.adminFlag === true);
			if (adminQueryResult?.length > 0) {
			  storeValue("adminFlag", true, true);
				storeValue("username", adminQueryResult[0].username, true);
				navigateTo('Admin Dashboard');
			} 
		} else {
			let volunteerQueryResult = loginQueryResult.filter(x => x.adminFlag === false);
			if (volunteerQueryResult?.length > 0) {
				storeValue("adminFlag", false, true);
				storeValue("username", volunteerQueryResult[0].username, true);
				navigateTo('Volunteer Event Listing');
			}
		}
	} else {
		showAlert('incorrect user and/or password','warning');
	}
	}

